(function($){if(typeof wpmfImportGallery==="undefined"){return}if(typeof ajaxurl==="undefined"){ajaxurl=wpmfImportGallery.vars.ajaxurl}$(document).ready(function(){var importWpmfgallery=function(doit,button){jQuery(button).closest("p").find(".spinner").show().css({visibility:"visible"});jQuery.post(ajaxurl,{action:"import_gallery",doit:doit,wpmf_nonce:wpmfImportGallery.vars.wpmf_nonce},function(response){if(response==="error time"){jQuery("#wmpfImportgallery").click()}else{jQuery(button).closest("div#wpmf_error").hide();if(doit===true){jQuery("#wpmf_error").after("<div class='updated'> <p><strong>NextGEN galleries successfully imported in WP Media Folder</strong></p></div>")}}})};$("#wmpfImportgallery").on("click",function(){var $this=$(this);importWpmfgallery(true,$this)});$(".wmpfNoImportgallery").on("click",function(){var $this=$(this);importWpmfgallery(false,$this)})})})(jQuery);